  .wrap { min-height:100%; display:flex; align-items:center; justify-content:center; padding:28px 16px; }
  .card {
    width:100%; max-width:560px;
    background: rgba(255,255,255,.94);
    border:2px solid #000; border-radius:28px;
    padding:26px 22px 22px; box-shadow:0 18px 40px rgba(0,0,0,.12);
  }
  .logo { display:flex; justify-content:center; margin-bottom:8px; }
  .logo img { width:180px; height:auto; border-radius:18px; }
  .title { text-align:center; margin:4px 0 2px; font-weight:900; font-size:20px; letter-spacing:.3px; }
  .sub { text-align:center; margin:0 0 16px; opacity:.75; font-size:13px; }
  .btns { display:grid; gap:12px; }
  a.btn {
    display:flex; align-items:center; gap:12px;
    text-decoration:none; padding:14px 16px;
    border-radius:16px; font-weight:900;
    background:#fff; border:2px solid #000;
    box-shadow:4px 4px 0 #000; transition: transform .05s, box-shadow .1s;
  }
  a.btn:active { transform: translate(2px,2px); box-shadow:2px 2px 0 #000; }
  .ico { width:22px; height:22px; flex:0 0 22px; }
  .cta {
    display:block; text-align:center; margin-top:16px;
    background:var(--accent); color:#fff; text-decoration:none;
    font-weight:900; padding:16px 18px; border-radius:18px;
    border:2px solid #000; box-shadow:4px 4px 0 #000;
  }
  .foot { text-align:center; margin-top:12px; font-size:12px; opacity:.6; }
</style>
</head>
